}
// footer
function Footer(){
  return(
    <div className="footer">
      <h3>Contact</h3>
      <p>+91 9876234678</p>
      <p>perfumy@gmail.com</p>

    </div>
  )
}
root.render(<div>
  <Navbar></Navbar>
  <Searchbar></Searchbar>
  <About></About>
  <Footer></Footer>
</div>)
